import React, { Component } from 'react';
import { connect } from 'react-redux';

class Admin extends Component {
    render() {
        return (
            <div>
                ADMIN
            </div>
        )
    }
}

const mapStateToProps = state => ({
    auth: state.authReducer
})
export default connect(mapStateToProps, {})(Admin)
